import React, { Component } from "react";
import styled from "styled-components";

class Footer extends Component {
  render() {
    const Div_footer_main = styled.div`
    height: 447px;
    width: auto;
    position: relative;
top: -1982px;
margin: 0 auto;
z-index: 200;
    `

    const P_footer_about = styled.p`
      font-family: "Alegreya Sans", sans-serif;
      font-size: 25px;
      font-weight: 500;
      color: rgba(74,74,74,0.49);
      letter-spacing: 0.77px;
    `

    const P_footer_titles = styled.p`
    font-family: "Alegreya Sans", sans-serif;
    font-size: 20px;
    color: rgba(232,134,31,0.90);
    letter-spacing: 0.62px;
        `



    return (
      <Div_footer_main>
      <P_footer_about>ABOUT</P_footer_about>
      <P_footer_titles>PROJECT</P_footer_titles>
      <P_footer_titles>ME</P_footer_titles>

      </Div_footer_main>
    );
  }
}

export default Footer;
